sys_variable_value.value:
(function execute(inputs, outputs) {
    var response = JSON.parse(inputs.response);
    if (inputs.status == '204') {

        outputs.status = "Success";
    } else {
        outputs.status = "Error";
        if (inputs.status == '404') {
            outputs.error_message = "The organization does not exist.";
        } else {
            outputs.error_message = inputs.error_message;
        }
    }
})(inputs, outputs);

